import React from "react";
import styled from "styled-components";
import NewItems from "../../components/product/NewItems";

const StyleNews = styled.div`
margin-top: 5rem;
  display: flex;
  .new-left {
    width: 60%;
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    grid-template-rows: 200px 200px 200px 200px;
  }
  .new-right {
    width: 40%;
  }
`;

const News = () => {
  return (
    <StyleNews>
      <div className="container">
        <div className="new-left">
          <NewItems></NewItems>
          <NewItems></NewItems>
          <NewItems></NewItems>
          <NewItems></NewItems>
          <NewItems></NewItems>
          <NewItems></NewItems>
          <NewItems></NewItems>
          <NewItems></NewItems>
        </div>
        <div className="new-right"></div>
      </div>
    </StyleNews>
  );
};

export default News;
